import { Component } from "react";
import TbInputControl from "../UI/TbInputControl";

class CreateNewUser extends Component{
    constructor(props) {
        super(props);
        this.state = {
            name:'',
            address: '',
            username: '',
            password: '',
            email: '',
            phoneNumber: '',
            cnic: '',
            gender: '',
        };
        this.LoadUserList = this.LoadUserList.bind(this);
    }

    render(){
        return(
            <>
            <div className="jumbotron mt-3">
                <h3>Create New User</h3>
                    <TbInputControl Name={'Full Name'} inutType={'text'} ctrlName={'GetFullName'} />
                    <TbInputControl Name={'User Name'} inutType={'text'} ctrlName={'GetUserName'} />
                    <TbInputControl Name={'E-mail'} inutType={'email'} ctrlName={'GetEmail'} />
                    <TbInputControl Name={'Password'} inutType={'password'} ctrlName={'GetPassword'} />
                    <TbInputControl Name={'Phone Number'} inutType={'text'} ctrlName={'GetPhone'} />
                    <TbInputControl Name={'CNIC'} inutType={'text'} ctrlName={'GetCNIC'} />
                    <TbInputControl Name={'Complete Address'} inutType={'text'} ctrlName={'GetAddress'} />
                    <TbInputControl Name={'Gender'} inutType={'text'} ctrlName={'GetGender'} />
                </div>
    
            </>
        )
    }
}

export default CreateNewUser;
